<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Inhibition of p38alpha MAPK disrupts the pathological loop of proinflammatory factor production in the myelodysplastic syndrome bone marrow microenvironment . Myelodysplastic syndromes ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) are common causes of ineffective hematopoiesis and cytopenias in the elderly . Various myelosuppressive and proinflammatory cytokines have been implicated in the high rates of apoptosis and hematopoietic suppression seen in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P43034
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . We have previously shown that p38 MAPK is overactivated in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P43034
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 hematopoietic progenitors , which led to current clinical studies of the selective p38alpha inhibitor , 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05412
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , in this disease . We now demonstrate that the myelosuppressive cytokines TNFalpha and IL - 1beta are secreted by bone marrow ( BM ) cells in a p38 MAPK-dependent manner . Their secretion is stimulated by paracrine interactions between BM stromal and mononuclear cells and cytokine induction correlates with 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P28906
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 + stem cell apoptosis in an inflammation-simulated in vitro bone marrow microenvironment . Treatment with 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05412
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 inhibits 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 secretion in primary 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P43034
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 bone marrow cells and protects cytogenetically normal progenitors from apoptosis ex vivo . Furthermore , p38 inhibition diminishes the expression of TNFalpha or IL - 1beta - induced proinflammatory chemokines in BM stromal cells . These data indicate that p38 inhibition has anti-inflammatory effects on the bone marrow microenvironment that complements its cytoprotective effect on progenitor survival . These findings support clinical investigation of p38alpha as a potential therapeutic target in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 and other related diseases characterised by inflammatory bone marrow failure .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Ca2 + response of rat mesangial cells to DB00171 analogues . The aim of this investigation was to characterise the effects of DB00171 analogues and UTP on the single cell intracellular Ca2 + concentration ( [ Ca2 + ] i ) in cultured rat mesangial cells . Typically , there were two phases in the Ca2 + response to the agonists , an initial fast transient peak and a subsequent slower decline , or plateau , phase . For the peak amplitude in [ Ca2 + ] i the agonists had about equal effect . But when taking in consideration the percentage of responding cells and the integrated Ca2 + response over 1 min , the order of efficacy of nucleotide agonists ( 100 microM ) was UTP = DB00171 &gt; ATPgammaS &gt; ADP = 2MeS - DB00171 ( 2 - methylthio - DB00171 ) . DB00640 , AMP and beta , gamma-Me - DB00171 ( 100 microM ) had no effect .

<div class="entities" style="line-height: 2.5; direction: ltr">Interpretation of point-of-care INR results in patients treated with dabigatran . BACKGROUND : Point-of-care devices for measurement of the international normalized ratio ( INR ) are commonly used to monitor therapy and maintain therapeutic levels of anticoagulation in patients treated with vitamin K antagonists . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06695

</mark>

</mark>
 , a new oral , reversible direct thrombin inhibitor approved for stroke prevention in patients with atrial fibrillation does not require routine coagulation monitoring . However , case reports have identified falsely elevated point-of-care INR levels in patients treated with dabigatran using one of these devices ( Hemochron ) . This in vitro study was designed to verify this issue . METHODS : We compared INR levels in whole blood and plasma using a Hemochron Jr . Signature + point-of-care device ( International Technidyne Corporation , Edison , NJ ) with routine laboratory monitoring , using blood from healthy volunteers that was spiked with increasing concentrations of dabigatran . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00734
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 time and INR levels were increased about 2 - to 4 - fold with the point-of-care device compared with laboratory measures across the plasma dabigatran concentration range 50-1400 ng / mL . At plasma concentrations of dabigatran likely to be observed in patients , at a dose of 150 mg twice daily ( 60-275 ng / mL ) , whole blood point-of-care INR values increased from 1.7 to 4.0 , versus 1.1 to 1.5 measured with the laboratory coagulometer . Similar differences in prothrombin time were observed in plasma samples . CONCLUSIONS : INR levels in patients taking dabigatran are substantially higher using a Hemochron Jr . point-of-care device compared with laboratory values . We discourage the use of these devices specifically , as well as the use of the INR in general , for measuring the anticoagulant effect of dabigatran .</div>

<h2 style="margin: 0">11</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Pannexin 1 channels link chemoattractant receptor signaling to local excitation and global inhibition responses at the front and back of polarized neutrophils . Neutrophil chemotaxis requires excitatory signals at the front and inhibitory signals at the back of cells , which regulate cell migration in a chemotactic gradient field . We have previously shown that DB00171 release via pannexin 1 ( Q96RD7 ) channels and autocrine stimulation of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P41231
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptors contribute to the excitatory signals at the front . Here we show that Q96RD7 also contributes to the inhibitory signals at the back , namely by providing the ligand for A2A adenosine receptors . In resting neutrophils , we found that A2A receptors are uniformly distributed across the cell surface . In polarized cells , A2A receptors redistributed to the back where their stimulation triggered intracellular DB02527 accumulation and protein kinase A ( PKA ) activation , which blocked chemoattractant receptor signaling . Inhibition of Q96RD7 blocked A2A receptor stimulation and DB02527 accumulation in response to formyl peptide receptor stimulation . Treatments that blocked endogenous A2A receptor signaling impaired the polarization and migration of neutrophils in a chemotactic gradient field and resulted in enhanced 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29323
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and p38 MAPK signaling in response to formyl peptide receptor stimulation . These findings suggest that chemoattractant receptors require Q96RD7 to trigger excitatory and inhibitory signals that synergize to fine-tune chemotactic responses at the front and back of neutrophils . Q96RD7 channels thus link local excitatory signals to the global inhibitory signals that orchestrate chemotaxis of neutrophils in gradient fields .</div>

 receptors and as an antagonist at

 receptors . In animals , agomelatine was shown to increase noradrenaline and dopamine ( but not serotonin ) in the frontal cortex , to resynchronize the sleep-wake cycle in models with disrupted circadian rhythms , and to exhibit a clear antidepressant effect in various animal models of depression . On the basis of the functional relationship between melatonergic and serotonergic signaling in the suprachiasmatic nucleus , and given agomelatine ' s affinity at melatonergic and

 ) family cytokines increased both the glu-tubulin content and glu-MT density . When we examined a role for

 - inhibitor U0126 increased glu-MT density in either control cardiac myocytes or following exposure to hypertrophic agents . Conversely , expression of an activated

<div class="entities" style="line-height: 2.5; direction: ltr">NSA 9 , a human prothrombin kringle - 2 - derived peptide , acts as an inhibitor of kringle - 2 - induced activation in EOC 2 microglia . In neurodegenerative diseases , such as Alzheimer ' s and Parkinson ' s , microglial cell activation is thought to contribute to CNS injury by producing neurotoxic compounds .

 and kringle - 2 increase levels of NO and the mRNA expression of

</mark>
 , IL - 1beta , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 in microglial cells . In contrast , the human prothrombin kringle - 2 derived peptide NSA 9 inhibits NO release and the production of pro-inflammatory cytokines such as IL - 1beta , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 in LPS-activated EOC 2 microglia . In this study , we investigated the anti-inflammatory effects of NSA 9 in human prothrombin - and kringle - 2 - stimulated EOC 2 microglia . Treatment with 20-100 muM of NSA 9 attenuated both prothrombin - and kringle - 2 - induced microglial activation . NO production induced by MAPKs and NF-kappaB was similarly reduced by inhibitors of

 ( PD98059 ) , p38 ( SB203580 ) , NF-kappaB ( DB06151 ) , and NSA 9 . These results suggest that NSA 9 acts independently as an inhibitor of microglial activation and that its effects in EOC 2 microglia are not influenced by the presence of kringle - 2 .</div>

<h2 style="margin: 0">17</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">

 inhibitors suppress apoptosis through off-target inhibition of JNK signaling .

 and dabrafenib selectively inhibit the

 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 activation to induce cSCC , suggesting broad implications for understanding toxicities associated with

 inhibitors and for their use in combination therapies . DOI : http://dx.doi.org/10.7554/eLife.00969.001 .</div>

 ) and a truncated form of Pseudomonas exotoxin ( PE38QQR ) . Convection-enhanced delivery ( DB01333 ) is a locoregional-administration method leading to high-tissue concentrations with large volume of distributions . We assessed the use of intracerebral DB01333 to deliver CB in patients with recurrent malignant glioma ( MG ) . PATIENTS AND METHODS : Three phase I clinical studies evaluated intracerebral DB01333 of CB along with tumor resection . The main objectives were to assess the tolerability of various concentrations and infusion durations ; tissue distribution ; and methods for optimizing delivery . All patients underwent tumor resection followed by a single intraparenchymal infusion ( in addition to the intraparenchymal one following resection ) , with a portion of patients who had a preresection intratumoral infusion . RESULTS : A total of 51 patients with MG were treated including 46 patients with GBM . The maximum tolerated intraparenchymal concentration was 0.5 microg / mL and tumor necrosis was observed at this concentration . Infusion durations of up to 6 days were well tolerated . Postoperative catheter placement appears to be important for optimal drug distribution . CB - and procedure-related adverse events were primarily limited to the CNS . Overall median survival for GBM patients is 42.7 weeks and 55.6 weeks for patients with optimally positioned catheters with patient follow-up extending beyond 5 years . CONCLUSION : CB appears to have a favorable risk-benefit profile . DB01333 is a complex delivery method requiring catheter placement via a second procedure to achieve accurate catheter positioning , better drug distribution , and better outcome .</div>
